+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="D1080ED6450A8F14621E13872DDE5CCD", NativeString="Have fun playing this week's New or Featured Songs!", LocalizedStrings=(("ar","استمتع بعزف الأغاني الجديدة أو المميزة لهذا الأسبوع!"),("de","Viel Spaß mit den neuen oder vorgestellten Songs dieser Woche!"),("es","Diviértete tocando las canciones nuevas o destacadas de esta semana."),("es-419","Diviértete tocando las canciones nuevas o destacadas de esta semana."),("fr","Amusez-vous en jouant les chansons à la une ou les nouveautés de cette semaine !"),("it","Divertiti a suonare le canzoni nuove o in evidenza di questa settimana!"),("ja","今週の新規またはおすすめの曲をプレイして楽しもう！"),("ko","이번 주의 새로운 곡 또는 추천 곡을 즐겨보세요!"),("pl","Baw się dobrze, grając nowe lub wyróżnione utwory!"),("pt-BR","Divirta-se tocando uma Música Nova ou em Destaque desta semana!"),("ru","Веселись от души, играя новые или рекомендуемые песни этой недели!"),("tr","Bu haftanın Yeni veya Öne Çıkan Şarkılarını oynarken tadını çıkar!")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="E24EAF744E1B83E246658596475BCFB3", NativeString="You have to earn all Stars in one setlist. Be ready to play your best!", LocalizedStrings=(("ar","عليك أن تكسب كل النجوم في قائمة أغاني واحدة. كن مستعدًا للعزف بأفضل ما لديك!"),("de","Du musst alle Sterne in einer Setlist erhalten. Sei bereit, dein Bestes zu geben!"),("es","Tienes que conseguir todas las estrellas con un solo repertorio. ¡Esfuérzate al máximo!"),("es-419","Tienes que conseguir todas las estrellas con solo un repertorio. ¡Esfuérzate al máximo!"),("fr","Vous devez obtenir toutes les étoiles sur un programme. Donnez-vous à fond !"),("it","Devi ottenere tutte le Stelle in una scaletta. Preparati a dare il tuo meglio!"),("ja","1つのセットリストでスターを全て獲得しなければならない。最高のパフォーマンスを発揮しよう！"),("ko","하나의 연주곡 세트에서 모든 별점을 획득해야 합니다. 최고의 연주를 준비하세요!"),("pl","Musisz zdobyć wszystkie gwiazdki, grając jedną setlistę. Przygotuj się i daj czadu!"),("pt-BR","Você precisa ganhar todas as estrelas de um setlist. Prepare-se para dar o seu melhor!"),("ru","Необходимо заработать все звезды за одно выступление. Выкладывайся по полной!"),("tr","Tek şarkı listesinde tüm Yıldızları kazanmalısın. En iyi oyununu ortaya koymaya hazırlan!")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="C5B8C34A41915EAC59E3059C4640146F", NativeString="<text color=\"FFFFFFFF\">Ghost or Shadow, the choice is yours. </> Includes the following cosmetics:", LocalizedStrings=(("ar","<text color=\"FFFFFFFF\">الشبح أم الظل، الاختيار لك. لن يكون هذا العرض متاحًا اعتبارًا من 9 يونيو 2024 الساعة 3 صباحًا بتوقيت الرياض، وقد يعود في المستقبل.</> تشمل عناصر الزينة التالية:"),("en","<text color=\"FFFFFFFF\">Ghost or Shadow, the choice is yours. This offer will no longer be available as of June 9th '24 00:00 UTC, and may return in the future.</> Includes the following cosmetics:"),("de","<text color=\"FFFFFFFF\">Ghost oder Shadow? Du hast die Wahl. Dieses Angebot wird ab dem 09. Juni 2024 um 02:00 Uhr MESZ nicht mehr verfügbar sein, es kann aber in Zukunft wiederkehren.</> Enthält die folgenden kosmetischen Gegenstände:"),("es","<text color=\"FFFFFFFF\">Sombra o Espectro, tú eliges. Esta oferta dejará de estar disponible el 9 de junio de 2024 a las 2:00 CEST, pero puede que vuelva en el futuro.</> Incluye los siguientes objetos cosméticos:"),("es-419","<text color=\"FFFFFFFF\">Sombra o Espectro, tú eliges. Esta oferta dejará de estar disponible el 8 de junio de 2024 a las 21:00 AR y 18:00 MX, pero puede que vuelva en el futuro.</> Incluye estos objetos de contenido estético:"),("fr","<text color=\"FFFFFFFF\">Ombre ou Fantôme, le choix vous appartient. Cette offre ne sera plus disponible à compter du 9 juin 2024 à 2h (CEST), mais pourrait revenir ultérieurement.</> Contient les objets cosmétiques suivants :"),("it","<text color=\"FFFFFFFF\">Spettri o Ombre, la scelta è tua. Questa offerta non sarà più disponibile a partire dalle ore 00:00 UTC del 9 giugno 2024, ma potrebbe tornare in futuro.</> Include i seguenti oggetti estetici:"),("ja","<text color=\"FFFFFFFF\">ゴーストかシャドーか。選択するのは君だ。本オファーは日本時間の2024年6月9日午前9時に提供を終了します。オファーの提供は後日再開する場合があります。</>次のビジュアルアイテムを収録:"),("ko","<text color=\"FFFFFFFF\">고스트 또는 섀도우. 선택은 당신의 몫입니다. 이 혜택은 6월 9일 오전 9시(한국 시간)부터 이용할 수 없으며, 나중에 돌아올 수도 있습니다.</> 구성품:"),("pl","<text color="FFFFFFFF">Duch czy Mrok? Wybór należy do ciebie. Oferta przestanie obowiązywać 9 czerwca 2024 r., o godz. 00:00 czasu UTC, lecz może powrócić w przyszłości.</> Zawiera następujące elementy kosmetyczne:"),("pt-BR","<text color=\"FFFFFFFF\">Espectro ou Sombra: a escolha é sua. Esta oferta não estará mais disponível a partir de 9 de junho de 2024, às 21h (BRT), mas pode retornar futuramente.</> Inclui os seguintes itens cosméticos:"),("ru","<text color=\"FFFFFFFF\">«Тень» или «Призрак»? Выбор за вами. Это предложение будет доступно до 9 июня 2024 г., 3:00 по московскому времени, однако оно может вернуться в будущем.</> В наборе:"),("tr","<text color=\"FFFFFFFF\">Aydınlık mı, Karanlık mı? Seçim senin! 9 Haziran 2024 TSİ 03.00 itibarıyla bu teklif oyundan kalkacak ama gelecekte tekrar dönebilir.</> Şu kozmetik eşyaları içerir:")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="4610A4E746378C0ABAA774BE8E41D680", NativeString="<text color=\"FFFFFFFF\">Strike from the shadows with the SHADOW PICKAXE PACK.</> Includes the following cosmetics:", LocalizedStrings=(("ar","<text color=\"FFFFFFFF\">باغت العدو بالهجوم عليه مع حزمة فأس الظل. لن يكون هذا العرض متاحًا اعتبارًا من 9 يونيو 2024 الساعة 3 صباحًا بتوقيت الرياض، وقد يعود في المستقبل.</> تشمل عناصر الزينة التالية:"),("en","<text color=\"FFFFFFFF\">Strike from the shadows with the SHADOW PICKAXE PACK. This offer will no longer be available as of June 9th '24 00:00 UTC, and may return in the future.</> Includes the following cosmetics:"),("de","<text color=\"FFFFFFFF\">Schlage aus dem Schatten zu mit dem SHADOW-SPITZHACKENPAKET. Dieses Angebot wird ab dem 09. Juni 2024 um 02:00 Uhr MESZ nicht mehr verfügbar sein, es kann aber in Zukunft wiederkehren.</> Enthält die folgenden kosmetischen Gegenstände:"),("es","<text color=\"FFFFFFFF\">Sorpréndelos desde las sombras con el PACK DE PICO DE SOMBRA. Esta oferta dejará de estar disponible el 9 de junio de 2024 a las 2:00 CEST, pero puede que vuelva en el futuro.</> Incluye los siguientes objetos cosméticos:"),("es-419","<text color=\"FFFFFFFF\">Golpea desde las sombras con el PAQUETE PICO DE SOMBRA. Esta oferta dejará de estar disponible el 8 de junio de 2024 a las 21:00 AR y 18:00 MX, pero puede que vuelva en el futuro.</> Incluye estos objetos de contenido estético:"),("fr","<text color=\"FFFFFFFF\">Frappez depuis les ombres avec le pack Pioches de l'Ombre. Cette offre ne sera plus disponible à compter du 9 juin 2024 à 2h (CEST), mais pourrait revenir ultérieurement.</> Contient les objets cosmétiques suivants :"),("it","<text color=\"FFFFFFFF\">Colpisci dalle ombre con il PACCHETTO PICCONE OMBRE. Questa offerta non sarà più disponibile a partire dalle ore 00:00 UTC del 9 giugno 2024, ma potrebbe tornare in futuro.</> Include i seguenti oggetti estetici:"),("ja","<text color=\"FFFFFFFF\">シャドー ツルハシパックで影から仕留めろ。本オファーは日本時間の2024年6月9日午前9時に提供を終了します。オファーの提供は後日再開する場合があります。</>次のビジュアルアイテムを収録:"),("ko","<text color=\"FFFFFFFF\">섀도우 곡괭이 팩으로 어둠에서 기습 공격하세요. 이 혜택은 6월 9일 오전 9시(한국 시간)부터 이용할 수 없으며, 나중에 돌아올 수도 있습니다.</> 구성품:"),("pl","<text color=\"FFFFFFFF\">Uderz z cienia z ZESTAWEM KILOFÓW MROKU. Oferta przestanie obowiązywać 9 czerwca 2024 r., o godz. 00:00 czasu UTC, lecz może powrócić w przyszłości.</> Zawiera następujące elementy kosmetyczne:"),("pt-BR","<text color=\"FFFFFFFF\">Ataque das sombras com o PACOTE DE PICARETAS SOMBRA. Esta oferta não estará mais disponível a partir de 9 de junho de 2024, às 21h (BRT), mas pode retornar futuramente.</> Inclui os seguintes itens cosméticos:"),("ru","<text color=\"FFFFFFFF\">Затаитесь в тени и нанесите внезапный удар, вооружившись набором кирок «Тени»! Это предложение будет доступно до 9 июня 2024 г., 3:00 по московскому времени, однако оно может вернуться в будущем.</> В наборе:"),("tr","<text color=\"FFFFFFFF\">KARANLIK KAZMA PAKETİ'yle gölgelerden saldır. 9 Haziran 2024 TSİ 03.00 itibarıyla bu teklif oyundan kalkacak ama gelecekte tekrar dönebilir.</> Şu kozmetik eşyaları içerir:")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="C74F32C34ABF90CF1D8F26A641F586CA", NativeString="<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Turn things up to maxx volume and rock ‘em deadstock. Get your kicks with the Airphoria Pack.</>\r\n\r\nThis pack contains:", LocalizedStrings=(("ar","<text color=\"FFFFFFFF\" Fontface=\"black\" size=\"20\" Case=\"AllCaps\">ارفع النغمات إلى أعلى صوت وكن وفيّ للتشكيلة من أولها لآخرها. استمتع إلى أقصى درجة مع حزمة Airphoria.. لن يكون هذا العرض متاحًا اعتبارًا من 5 يونيو 2024 الساعة 3 صباحًا بتوقيت الرياض، وقد يعود في المستقبل.</>\r\n\r\nتحتوي هذه الحزمة على:"),("en","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Turn things up to maxx volume and rock ‘em deadstock. Get your kicks with the Airphoria Pack. This offer will no longer be available as of June 5th '24 00:00 UTC, and may return in the future.</>\r\n\r\nThis pack contains:"),("de","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Mach deiner Musik Luft. Nie ganz vergessen. Schnapp dir neue Schuhe mit dem Airphoria-Paket. Dieses Angebot wird ab dem 05. Juni 2024 um 02:00 Uhr MESZ nicht mehr verfügbar sein, es kann aber in Zukunft wiederkehren.</>\r\n\r\nDieses Paket enthält:"),("es","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Sube el volumen al máximo y quédate con todo el inventario. Sal a divertirte con el pack de Airphoria. Esta oferta dejará de estar disponible el 5 de junio de 2024 a las 2:00 CEST, pero puede que vuelva en el futuro.</>\r\n\r\nEste pack incluye:"),("es-419","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Sube el volumen al máximo y quédate con todo el inventario. Sal a divertirte con el paquete Airphoria. Esta oferta dejará de estar disponible el 4 de junio de 2024 a las 21:00 AR y 18:00 MX, pero puede que vuelva en el futuro.</>\r\n\r\nEste paquete contiene:"),("fr","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Montez le volume au max et faites un carton. Soyez toujours bien chaussé avec le pack Airphoria. Cette offre ne sera plus disponible à compter du 5 juin 2024 à 2h (CEST), mais pourrait revenir ultérieurement.</>\r\n\r\nContient les objets cosmétiques suivants :"),("it","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Porta al massimo lo stile e fallo tuo. Indossa le tue scarpe preferite con il pacchetto Airforia. Questa offerta non sarà più disponibile a partire dalle ore 00:00 UTC del 5 giugno 2024, ma potrebbe tornare in futuro.</>\r\n\r\nQuesto pacchetto contiene:"),("ja","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">音量を最大まで上げて、デッドストックでクールにキメよう。Airphoriaパックで一歩を踏み出せ。本オファーは日本時間の2024年6月5日午前9時に提供を終了します。オファーの提供は後日再開する場合があります。</>\r\n\r\n本パックの内容:"),("ko","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">볼륨을 맥스로 올리고 재고를 싹쓸이하세요. 에어포리아 팩으로 새 신발을 신으세요. 이 혜택은 6월 5일 오전 9시(한국 시간)부터 이용할 수 없으며, 나중에 돌아올 수도 있습니다.</>\r\n\r\n팩 구성품:"),("pl","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Podkręć głośność na maksa i pokaż wszystkim, kto tu rządzi. Wybij się dzięki pakietowi Airforia. Oferta przestanie obowiązywać 5 czerwca 2024 r., o godz. 00:00 czasu UTC, lecz może powrócić w przyszłości.</>\r\n\r\nPakiet zawiera:"),("pt-BR","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Coloque no volume máximo e aproveite o Pacote Airphoria para arrebentar na batalha. Esta oferta não estará mais disponível a partir de 5 de junho de 2024, às 21h (BRT), mas pode retornar futuramente.</>\r\n\r\nO pacote inclui:"),("ru","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Громкость и скорость на максимум! Покоряйте мир с набором Airphoria. Это предложение будет доступно до 5 июня 2024 г., 3:00 по московскому времени, однако оно может вернуться в будущем.</>\r\n\r\nВ наборе:"),("tr","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Sesi maksimuma yükselt ve zaferini istifle. AIRPHORIA Paketi ile oyun keyfini maksimuma taşı. 5 Haziran 2024 TSİ 03.00 itibarıyla bu teklif oyundan kalkacak ama gelecekte tekrar dönebilir.</>\r\n\r\nPaket şunları içerir:")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="7F2EDE164B1EDB6E97032C9A8A641C86", NativeString="<text color=\"FFFFFFFF\">Take control and strike back with the Cyber Infiltration Pack.</> Includes the following cosmetics:", LocalizedStrings=(("ar","<text color=\"FFFFFFFF\">تول زمام الأمور وقاوم بحزمة التسلل الإلكترونية. لن يكون هذا العرض متاحًا اعتبارًا من 6 يونيو 2024 الساعة 3 صباحًا بتوقيت الرياض، وقد يعود في المستقبل.</> تشمل عناصر الزينة التالية:"),("en","<text color=\"FFFFFFFF\">Take control and strike back with the Cyber Infiltration Pack. This offer will no longer be available as of June 6th '24 00:00 UTC, and may return in the future.</> Includes the following cosmetics:"),("de","<text color=\"FFFFFFFF\">Übernimm die Kontrolle und schlag zurück – mit dem Cyber-Infiltration-Paket. Dieses Angebot wird ab dem 06. Juni 2024 um 02:00 Uhr MESZ nicht mehr verfügbar sein, es kann aber in Zukunft wiederkehren.</> Enthält die folgenden kosmetischen Gegenstände:"),("es","<text color=\"FFFFFFFF\">Toma el control y véngate con el pack de Infiltración cibernética. Esta oferta dejará de estar disponible el 6 de junio de 2024 a las 2:00 CEST, pero puede que vuelva en el futuro.</> Incluye estos objetos cosméticos:"),("es-419","<text color=\"FFFFFFFF\">Toma el control y véngate con el paquete de infiltración cibernético. Esta oferta dejará de estar disponible el 5 de junio de 2024 a las 21:00 AR y 18:00 MX, pero puede que vuelva en el futuro.</> Incluye estos objetos de contenido estético:"),("fr","<text color=\"FFFFFFFF\">Prenez le contrôle et ripostez avec le pack Cyberinfiltration. Cette offre ne sera plus disponible à compter du 6 juin 2024 à 2h (CEST), mais pourrait revenir ultérieurement.</> Contient les objets cosmétiques suivants :"),("it","<text color=\"FFFFFFFF\">Assumi il controllo e reagisci con il pacchetto Infiltrazione cyber. Questa offerta non sarà più disponibile a partire dalle ore 00:00 UTC del 6 giugno 2024, ma potrebbe tornare in futuro.</> Include i seguenti oggetti estetici:"),("ja","<text color=\"FFFFFFFF\">サイバーインフィルトレーション パックで制圧し、反撃せよ。本オファーは日本時間の2024年6月6日午前9時に提供を終了します。オファーの提供は後日再開する場合があります。</>次のビジュアルアイテムを収録:"),("ko","<text color=\"FFFFFFFF\">사이버 침투 팩으로 모든 것을 통제하고 반격하세요. 이 혜택은 6월 6일 오전 9시(한국 시간)부터 이용할 수 없으며, 나중에 돌아올 수도 있습니다.</> 구성품:"),("pl","<text color=\"FFFFFFFF\">Odzyskaj kontrolę i kontratakuj z pakietem Cyber-infiltracja. Oferta przestanie obowiązywać 6 czerwca 2024 r., o godz. 00:00 czasu UTC, lecz może powrócić w przyszłości.</> Zawiera następujące elementy kosmetyczne:"),("pt-BR","<text color=\"FFFFFFFF\">Vire o jogo e revide com o Pacote Infiltração Cibernética. Esta oferta não estará mais disponível a partir de 6 de junho de 2024, às 21h (BRT), mas pode retornar futuramente.</> Inclui os seguintes itens cosméticos:"),("ru","<text color=\"FFFFFFFF\">Возьмите инициативу в свои руки и нанесите ответный удар с набором «Киберугроза». Это предложение будет доступно до 6 июня 2024 г., 3:00 по московскому времени, однако оно может вернуться в будущем.</> В наборе:"),("tr","<text color=\"FFFFFFFF\">Siber Casusluk Paketi ile kontrolü eline al ve karşı atağa geç. 6 Haziran 2024 TSİ 03.00 itibarıyla bu teklif oyundan kalkacak ama gelecekte tekrar dönebilir.</> Şu kozmetik eşyaları içerir:")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="07FD7EBB47131EE360BE238973764562", NativeString="<text color=\"FFFFFFFF\">Get animated with the tools of the trade.</> Includes the following cosmetics:", LocalizedStrings=(("ar","<text color=\"FFFFFFFF\">تحرك مع أدوات التجارة. لن يكون هذا العرض متاحًا اعتبارًا من 6 يونيو 2024 الساعة 3 صباحًا بتوقيت الرياض، وقد يعود في المستقبل.</> يشمل عناصر الزينة التالية:"),("en","<text color=\"FFFFFFFF\">Get animated with the tools of the trade. This offer will no longer be available as of June 6th '24 00:00 UTC, and may return in the future.</> Includes the following cosmetics:"),("de","<text color=\"FFFFFFFF\">Macht euch mit dem Handwerkszeug in diesem Metier vertraut. Dieses Angebot wird ab dem 06. Juni 2024 um 02:00 Uhr MESZ nicht mehr verfügbar sein, es kann aber in Zukunft wiederkehren.</> Enthält die folgenden kosmetischen Gegenstände:"),("es","<text color=\"FFFFFFFF\">¡Anímate con las herramientas adecuadas! Esta oferta dejará de estar disponible el 6 de junio de 2024 a las 2:00 CEST, pero puede que vuelva en el futuro.</> Incluye estos objetos cosméticos:"),("es-419","<text color=\"FFFFFFFF\">Anímate con las herramientas del oficio. Esta oferta dejará de estar disponible el 5 de junio de 2024 a las 21:00 AR y 18:00 MX, pero puede que vuelva en el futuro.</> Incluye estos objetos de contenido estético:"),("fr","<text color=\"FFFFFFFF\">Mettez de l'animation avec les bons outils. Cette offre ne sera plus disponible à compter du 6 juin 2024 à 2h (CEST), mais pourrait revenir ultérieurement.</> Contient les objets cosmétiques suivants :"),("it","<text color=\"FFFFFFFF\">Cimentati nell'animazione con gli attrezzi del mestiere. Questa offerta non sarà più disponibile a partire dalle ore 00:00 UTC del 6 giugno 2024, ma potrebbe tornare in futuro.</> Include i seguenti oggetti estetici:"),("ja","<text color=\"FFFFFFFF\">アニメ風の仕事道具を手に入れよう。本オファーは日本時間の2024年6月6日午前9時に提供を終了します。オファーの提供は後日再開する場合があります。</>次のビジュアルアイテムを収録:"),("ko","<text color=\"FFFFFFFF\">거래에 필요한 도구들로 활기를 되찾으세요. 이 혜택은 6월 6일 오전 9시(한국 시간)부터 이용할 수 없으며, 나중에 돌아올 수도 있습니다.</> 구성품:"),("pl","<text color=\"FFFFFFFF\">Weź się do dzieła i wykorzystaj swe narzędzia. Oferta przestanie obowiązywać 6 czerwca 2024 r., o godz. 00:00 czasu UTC, lecz może powrócić w przyszłości.</> Zawiera następujące elementy kosmetyczne:"),("pt-BR","<text color=\"FFFFFFFF\">Você vai se animar quando vir estes itens. Esta oferta não estará mais disponível a partir de 6 de junho de 2024, às 21h (BRT), mas pode retornar futuramente.</> Inclui os seguintes itens cosméticos:"),("ru","<text color=\"FFFFFFFF\">Инструменты нарисованные, но урон наносят самый настоящий. Это предложение будет доступно до 6 июня 2024 г., 3:00 по московскому времени, однако оно может вернуться в будущем.</> В наборе:"),("tr","<text color=\"FFFFFFFF\">İş için gerekli eşyalarla birlikte aksiyona animasyon kat. 6 Haziran 2024 TSİ 03.00 itibarıyla bu teklif oyundan kalkacak ama gelecekte tekrar dönebilir.</> Şu kozmetik eşyaları içerir:")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="42EB079342545C6BFD5F0786DB881474", NativeString="<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Toon in to the monochromatic misadventures of the Inkville Gang!</>\r\n\r\nThis pack contains:", LocalizedStrings=(("ar","<text color=\"FFFFFFFF\" Fontface=\"black\" size=\"20\" Case=\"AllCaps\">انغمس في مغامرات عصابة إنكفيل أحادية اللون! لن يكون هذا العرض متاحًا اعتبارًا من 3 مايو 2024 الساعة 3 صباحًا بتوقيت الرياض، وقد يعود في المستقبل.</>\r\n\r\nتحتوي هذه الحزمة على:"),("en","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Toon in to the monochromatic misadventures of the Inkville Gang! This offer will no longer be available as of May 31st '24 00:00 UTC, and may return in the future.</>\r\n\r\nThis pack contains:"),("de","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Schalte ein und schau dir die schwarz-weißen Abenteuer der Zeichentricktruppe an! Dieses Angebot wird ab dem 31. Mai 2024 um 02:00 Uhr MESZ nicht mehr verfügbar sein, es kann aber in Zukunft wiederkehren.</>\r\n\r\nDieses Paket enthält:"),("es","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">¡No te pierdas las desaventuras monocromáticas de Los Tintagonías! Esta oferta dejará de estar disponible el 31 de mayo de 2024 a las 2:00 CEST, pero puede que vuelva en el futuro.</>\r\n\r\nEste pack incluye:"),("es-419","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">¡No te pierdas las desaventuras monocromáticas de Los Tintagonías! Esta oferta dejará de estar disponible el 30 de mayo de 2024 a las 21:00 AR y 18:00 MX, pero puede que vuelva en el futuro.</>\r\n\r\nEste paquete contiene:"),("fr","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Éclatez-vous dans les aventures en noir et blanc des Zinzins animés ! Cette offre ne sera plus disponible à compter du 31 mai 2024 à 2h (CEST), mais pourrait revenir ultérieurement.</>\r\n\r\nContient les objets cosmétiques suivants :"),("it","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Sintonizza il canale sulle peripezie monocromatiche della Gang della china! Questa offerta non sarà più disponibile a partire dalle ore 00:00 UTC del 31 maggio 2024, ma potrebbe tornare in futuro.</>\r\n\r\nQuesto pacchetto contiene:"),("ja","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">インクヴィルギャングのモノクロの災難を救援しよう！ 本オファーは日本時間の2024年5月31日午前9時に提供を終了します。オファーの提供は後日再開する場合があります。</>\r\n\r\n本パックの内容:"),("ko","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">잉크빌 갱과 함께 단색의 세상을 경험해 보세요! 이 혜택은 5월 31일 오전 9시(한국 시간)부터 이용할 수 없으며, 나중에 돌아올 수도 있습니다.</>\r\n\r\n팩 구성품:"),("pl","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Wkręć się w czarno-białe perypetie Kreskówkowej Kompanii! Oferta przestanie obowiązywać 31 maja 2024 r., o godz. 00:00 czasu UTC, lecz może powrócić w przyszłości.</>\r\n\r\nPakiet zawiera:"),("pt-BR","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Anime seu dia com as desventuras monocromáticas da Turma do Tinteiro! Esta oferta não estará mais disponível a partir de 31 de maio de 2024, às 21h (BRT), mas pode retornar futuramente.</>\r\n\r\nO pacote inclui:"),("ru","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Мультсила — этот контраст не каждому по плечу! Это предложение будет доступно до 31 мая 2024 г., 3:00 по московскому времени, однако оно может вернуться в будущем.</>\r\n\r\nВ наборе:"),("tr","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Mürekkep Tayfası'nın siyah beyaz ve talihsiz maceralarına tanıklık et! 31 Mayıs 2024 TSİ 03.00 itibarıyla bu teklif oyundan kalkacak ama gelecekte tekrar dönebilir.</>\r\n\r\nPaket şunları içerir:")))
