+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="11A4D8504EB51D22A4AD1F8A8600698D", NativeString="<text color=\"FFEB63FF\">Carey</> <text color=\"FFFFFFFF\">Challenges. Earn up to 1,500 V-Bucks by completing </><text color=\"FFEB63FF\">Save the World</> <text color=\"FFFFFFFF\"> daily quests.</> <text color=\"FFEB63FF\">Challenges unlocked after having completed the \"Homebase Stormshield Defense 3\" mission in \"Save the World\" Campaign.</>", LocalizedStrings=(("en","<text color=\"FFEB63FF\">Carey</> <text color=\"FFFFFFFF\">Challenges. Earn up to 1,500 V-Bucks by completing </><text color=\"FFEB63FF\">Save the World</> <text color=\"FFFFFFFF\"> daily quests.</> <text color=\"FFEB63FF\">Challenges unlocked after having completed the \"Homebase Stormshield Defense 3\" mission in \"Save the World\" Campaign.</>"),("de","<text color=\"FFEB63FF\">Carey</><text color=\"FFFFFFFF\">-Herausforderungen. Verdiene bis zu 1.500 V-Bucks, indem du </><text color=\"FFFFFFFF\">tägliche Aufträge</> in <text color=\"FFEB63FF\">Rette die Welt</> abschließt. <text color=\"FFEB63FF\">Die Herausforderungen werden erst nach Abschluss von „Sturmschild-Verteidigung 3 in Heimatbasis“ in Rette die Welt freigeschaltet.</>"),("es","<text color=\"FFFFFFFF\">Desafíos de</> <text color=\"FFEB63FF\">Carey</><text color=\"FFFFFFFF\">. Consigue hasta 1500 paVos por completar las misiones diarias de </><text color=\"FFEB63FF\">Salvar el mundo</><text color=\"FFFFFFFF\">.</> <text color=\"FFEB63FF\">Los desafíos se desbloquean al completar la misión \"Defensa del escudo antitormentas 3\" de \"Salvar el mundo\".</>"),("es-419","<text color=\"FFFFFFFF\">Desafíos de</> <text color=\"FFEB63FF\">Carey</><text color=\"FFFFFFFF\">: obtén hasta 1500 monedas V al completar las misiones diarias de</> <text color=\"FFEB63FF\">Salva el mundo</>. <text color=\"FFEB63FF\">Los desafíos se obtienen después de completar la misión \"Defensa del escudo contra tormentas de la base 3\" en la campaña de \"Salva el mundo\".</>"),("fr","<text color=\"FFFFFFFF\">Les défis de</> <text color=\"FFEB63FF\">Carey</><text color=\"FFFFFFFF\">. Gagnez jusqu'à 1 500 V-bucks en accomplissant des quêtes quotidiennes de </><text color=\"FFEB63FF\">Sauver le monde</>. <text color=\"FFEB63FF\">Défis déverrouillés en terminant la 3e défense du bouclier antitempête dans Sauver le monde.</>")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="13D807D8464332B2C48348A6B1DB1FE5", NativeString="<text color=\"FF78F7FF\">Carey</> <text color=\"FFFFFFFF\">Outfit (with LEGO® Style)</>", LocalizedStrings=(("fr","<text color=\"FFFFFFFF\">La tenue </><text color=\"FF78F7FF\">Carey </><text color=\"FFFFFFFF\">(et sa version LEGO®)</>")))
